import React from 'react';
import { motion } from 'framer-motion';
import { ArrowLeft, Star, MapPin, Calendar, Phone, Mail, User } from 'lucide-react';
import { useApp } from '../../context/AppContext.tsx';

interface SellerProfileViewProps {
  sellerId: string;
  onBack: () => void;
}

export function SellerProfileView({ sellerId, onBack }: SellerProfileViewProps) {
  const { getUserProfile } = useApp();
  
  const seller = getUserProfile(sellerId);

  if (!seller) {
    return (
      <div className="space-y-6">
        <button
          onClick={onBack}
          className="btn-secondary flex items-center space-x-2"
        >
          <ArrowLeft className="w-5 h-5" />
          <span>Back to Listings</span>
        </button>
        
        <div className="glass-effect rounded-xl p-8 text-center">
          <User className="w-16 h-16 mx-auto mb-4 text-primary-400" />
          <h2 className="text-xl font-bold text-primary-100 mb-2">Seller Not Found</h2>
          <p className="text-primary-300">The seller profile could not be loaded.</p>
        </div>
      </div>
    );
  }

  return (
    <motion.div
      initial={{ opacity: 0, y: 20 }}
      animate={{ opacity: 1, y: 0 }}
      className="space-y-6"
    >
      {/* Back Button */}
      <button
        onClick={onBack}
        className="btn-secondary flex items-center space-x-2"
      >
        <ArrowLeft className="w-5 h-5" />
        <span>Back to Listings</span>
      </button>

      {/* Profile Header */}
      <div className="glass-effect rounded-xl p-6">
        <div className="flex items-start space-x-6">
          {/* Avatar */}
          <div className="w-20 h-20 bg-primary-500 rounded-full flex items-center justify-center flex-shrink-0">
            {seller.avatar ? (
              <img src={seller.avatar} alt={seller.username} className="w-full h-full rounded-full object-cover" />
            ) : (
              <User className="w-10 h-10 text-white" />
            )}
          </div>

          {/* Profile Info */}
          <div className="flex-1">
            <div className="flex items-center space-x-3 mb-2">
              <h1 className="text-2xl font-bold text-primary-100">
                {seller.firstName && seller.lastName 
                  ? `${seller.firstName} ${seller.lastName}`
                  : seller.username
                }
              </h1>
              {seller.rating && (
                <div className="flex items-center space-x-1">
                  <Star className="w-5 h-5 text-yellow-400 fill-current" />
                  <span className="text-primary-100 font-medium">{seller.rating.toFixed(1)}</span>
                  <span className="text-primary-300">({seller.reviewCount || 0} reviews)</span>
                </div>
              )}
            </div>

            <div className="space-y-2">
              {seller.location && (
                <div className="flex items-center space-x-2 text-primary-300">
                  <MapPin className="w-4 h-4" />
                  <span>{seller.location}</span>
                </div>
              )}
              
              <div className="flex items-center space-x-2 text-primary-300">
                <Calendar className="w-4 h-4" />
                <span>Member since {new Date(seller.createdAt).toLocaleDateString()}</span>
              </div>
            </div>
          </div>
        </div>

        {/* Contact Info */}
        <div className="mt-6 pt-6 border-t border-primary-700/30">
          <h3 className="text-lg font-semibold text-primary-100 mb-4">Contact Information</h3>
          <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
            <div className="flex items-center space-x-3">
              <Mail className="w-5 h-5 text-primary-400" />
              <span className="text-primary-200">{seller.email}</span>
            </div>
            {seller.phone && (
              <div className="flex items-center space-x-3">
                <Phone className="w-5 h-5 text-primary-400" />
                <span className="text-primary-200">{seller.phone}</span>
              </div>
            )}
          </div>
        </div>
      </div>

      {/* Placeholder for future features */}
      <div className="glass-effect rounded-xl p-6">
        <h3 className="text-lg font-semibold text-primary-100 mb-4">Seller's Other Listings</h3>
        <p className="text-primary-300">This feature will show other vehicles listed by this seller.</p>
      </div>

      <div className="glass-effect rounded-xl p-6">
        <h3 className="text-lg font-semibold text-primary-100 mb-4">Reviews & Ratings</h3>
        <p className="text-primary-300">This feature will show reviews from previous buyers.</p>
      </div>
    </motion.div>
  );
}
